var stars_cache = [];
var platesolve_done = false;
var platesolve_interrupt = false;
var platesolve_statemachine = null;
var platesolve_scorereq = 4;

var platesolve_start_x = -1;
var platesolve_start_y = -1;
var platesolve_primed = false;

function platesolver_prime()
{
    if (lastStatus == null || lastStatus == false || lastStatus == undefined) {
        document.getElementById("div_platesolvesolution").innerHTML = "No data available";
        return;
    }
    var stars = lastStatus["stars"];
    if (stars.length < 4) {
        document.getElementById("div_platesolvesolution").innerHTML = "Not enough stars";
        return;
    }

    $( "#btn_platesolve" ).button( "option", "disabled", true );
    $( "#btn_platesolvehalt" ).button( "option", "disabled", false );

    platesolve_primed = true;
    document.getElementById("div_platesolvesolution").innerHTML = "Click on a star!";
}

function platesolver_start()
{
    platesolve_primed = false;
    document.getElementById("title_platesolve").scrollIntoView();

    if (lastStatus == null || lastStatus == false || lastStatus == undefined) {
        document.getElementById("div_platesolvesolution").innerHTML = "No data available";
        return;
    }
    var stars = lastStatus["stars"];
    if (stars.length < 4) {
        document.getElementById("div_platesolvesolution").innerHTML = "Not enough stars";
        return;
    }

    // since the plate solving takes longer than a new image frame
    // we cache the current list of stars so it doesn't get overwritten when a new frame arrives
    stars_cache = [];
    stars.forEach(function(ele, idx) {
        var vcx = platesolve_start_x;
        var vcy = platesolve_start_y;
        var ecx = ele["cx"];
        var ecy = ele["cy"];
        var vc = math_getVector([vcx, vcy], [ecx, ecy]);
        var s = { cx: ecx, cy: ecy, r: ele["r"], b: ele["brightness"], dist: vc[0], ang: vc[1] };
        stars_cache.push(s);
    });

    var mindist = 9999;
    var centerstar = null;
    var centerstar_idx = -1;
    stars_cache.forEach(function(ele, idx) {
        if (ele.dist < mindist) {
            mindist = ele.dist;
            centerstar = ele;
            centerstar_idx = idx;
        }
    });

    platesolve_done = false;
    platesolve_interrupt = false;
    document.getElementById("div_platesolvesolution").innerHTML = "Working on it...";
    setTimeout(() => { platesolve_progress(); }, 1000);

    console.log("platesolve center_star: (" + centerstar.cx + ", " + centerstar.cy + ")");

    // make a list of stars that excludes the center star
    var farstars = [];
    stars_cache.forEach(function(ele, idx) {
        if (idx != centerstar_idx) {
            farstars.push(ele);
        }
    });

    platesolve_statemachine = { center_star: centerstar, far_stars: farstars, far_stars_cnt: farstars.length, kidx: 0, solutions: [] };
    setTimeout(() => { platesolve_tick(); }, 1);
}

function platesolve_tick()
{
    if (platesolve_statemachine.kidx >= star_database_cnt || platesolve_interrupt) {
        platesolve_finish();
        return;
    }
    var possibility = star_database[platesolve_statemachine.kidx];
    var checklist = possibility.nearby;

    var max_score = 0;
    var max_score_list = [];
    var min_error = -1;
    var rot;
    for (rot = 0; rot < 360; rot += 1)
    {
        var score = 0;
        var score_list = [];
        var err_sum = 0;
        var min_brite = platesolve_statemachine.center_star.b;
        var max_dist = 0;
        var nidx, nlen = checklist.length;
        for (nidx = 0; nidx < nlen; nidx++)
        {
            var fidx, flen = platesolve_statemachine.far_stars_cnt;
            for (fidx = 0; fidx < flen; fidx++)
            {
                var vect = math_getVector([platesolve_statemachine.center_star.cx, platesolve_statemachine.center_star.cy], [platesolve_statemachine.far_stars[fidx].cx, platesolve_statemachine.far_stars[fidx].cy]);
                var err_dist = Math.abs(vect[0] - checklist[nidx].dist);
                var expected_pos = math_movePointTowards([platesolve_statemachine.center_star.cx, platesolve_statemachine.center_star.cy], [checklist[nidx].dist, checklist[nidx].ang - rot]);
                var err_vect = math_getVector([platesolve_statemachine.far_stars[fidx].cx, platesolve_statemachine.far_stars[fidx].cy], expected_pos);
                if (err_vect[0] < 50)
                {
                    score += 1;
                    err_sum += err_vect[0];
                    if (platesolve_statemachine.far_stars[fidx].b < min_brite) {
                        min_brite = platesolve_statemachine.far_stars[fidx].b;
                    }
                    if (vect[0] > max_dist) {
                        max_dist = vect[0];
                    }
                    score_list.push(platesolve_statemachine.far_stars[fidx]);
                }
            }
        }
        err_sum /= score;
        if (score >= max_score && (min_error < 0 || err_sum < min_error))
        {
            platesolve_statemachine.far_stars.forEach(function(ele,idx) {
                var matched = false;
                // was this used in the match?
                score_list.forEach(function(ele2,idx2) {
                    if (ele.cx == ele2.cx && ele.cy == ele2.cy) {
                        matched = true;
                    }
                });

                if (matched == false)
                {
                    // nope it was not used in the match
                    // was this within the match area though?
                    var vect = math_getVector([platesolve_statemachine.center_star.cx, platesolve_statemachine.center_star.cy], [ele.cx, ele.cy]);
                    if (vect[0] < max_dist)
                    {
                        // within match area
                        // but was it brighter than some of the matches?
                        if (ele.b > min_brite)
                        {
                            // it was brighter, so then, why didn't the database have something that matched it?
                            // it could be a hot pixel
                            var hot_pix = checkHotPixel(ele);

                            // not a hot pixel, but brighter than some other stars, still within the matching area
                            // yet, it didn't match anything in the database?
                            // this becomes a penalty against the score
                            if (hot_pix == false)
                            {
                                score -= 0.5;
                            }
                        }
                    }
                }
            });

            if (score > max_score) {
                max_score = score;
            }
        }
    }

    if (max_score >= platesolve_scorereq) {
        platesolve_statemachine.solutions.push({name: possibility.name, score: max_score});
        document.getElementById("div_platesolvesolution").innerHTML += "[" + possibility.name + ": " + max_score + "]";
    }

    platesolve_statemachine.kidx += 1;
    setTimeout(() => { platesolve_tick(); }, 1);
}

function platesolve_progress()
{
    if (platesolve_done == false) {
        document.getElementById("div_platesolvesolution").innerHTML += ".";
        setTimeout(() => { platesolve_progress(); }, 1000);
    }
}

function platesolve_finish()
{
    platesolve_done = true; // stop the ticker
    platesolve_primed = false;

    $( "#btn_platesolve" ).button( "option", "disabled", false );
    $( "#btn_platesolvehalt" ).button( "option", "disabled", true );
    var div = document.getElementById("div_platesolvesolution");
    if (platesolve_statemachine.solutions.length <= 0)
    {
        div.innerHTML = "No solution";
    }
    else
    {
        platesolve_statemachine.solutions.sort(function(a, b) { return b.score - a.score; });
        var resstr = "TOP POSSIBILITIES ranked by score:<br /><ol>";
        var minscore = platesolve_statemachine.solutions[0].score;
        var inccnt = 0;
        if (platesolve_statemachine.solutions.length >= 10) {
            minscore = ((minscore - platesolve_scorereq) / 4) + platesolve_scorereq;
        }
        else {
            minscore = 0;
        }
        platesolve_statemachine.solutions.forEach(function(ele, idx) {
            if (inccnt < 5 || ele.score >= minscore) {
                resstr += "\r\n<li>[" + ele.score + "]: " + ele.name + "</li>";
            }
            inccnt += 1;
        });
        resstr += "\r\n</ol>\r\n";
        div.innerHTML = resstr;
    }
}

function star_onclick(x, y)
{
    platesolve_start_x = x;
    platesolve_start_y = y;
    if (platesolve_primed) {
        platesolver_start();
    }
}
